import React from 'react';

function SocialMedia(){
    return(
        <ul className="social-icon">
            <li><button><i className="fa fa-facebook" aria-hidden="true"></i></button></li>
            <li><button><i className="fa fa-twitter" aria-hidden="true"></i></button></li>
            <li><button><i className="fa fa-linkedin" aria-hidden="true"></i></button></li>
            <li><button><i className="fa fa-slack" aria-hidden="true"></i></button></li>
            <li><button><i className="fa fa-dribbble" aria-hidden="true"></i></button></li>
        </ul>
    );
    
}

export default SocialMedia;
